comment:
미친 싸이코아니야;
후크 조지면
나도 니 새끼 조지러 간다

야 ㄹㅇ 후크 몸에 상처 나있으면 
뉴스 잘봐두셈
뚝배기 깨지는 장면을 보게 될것이니;;

아니.. 무슨 분노조절장애냐..?;
싫다는 애 강제로 덮치려고 하고 지 혼자 빡쳐서 채찍 휘두르고 ㅋㅋㅋㅋㅋㅋ
확실한 건 진짜 개소름이다 ㄹㅇ

오늘은 후크가 안 나오네욤..ㅠ
..아니 근댜 저 새끼들은 왜 뒤에서 욕하는거야 ㅋ 뒷담화 노이해..;
앞에는 욕도 못 할것들이..앞답화를 내가 만들든지 말든지 해야겠어 ㅋㅋ

무슨 알지도못하면서 저리떠드냐;
손잡고다니면 무슨 다 연인관계야?  
사고방식부터가,,

적당히 즐겼으면 이제 그만 끊으라네ㅋㅋㅋ
아버지 인성ㅋㅋㅋ
후크가 무슨 장남감되는 것처럼 말하냐;

하루 형이 내일이라뇨;;
하루 다음엔 이틀이고,
그 다음에 사흘, 나흘…….

선배새기 저런것도 연기인거같아서 진짜 보기싫다;;
그동안 저렇게 애들 속여왓는데 또 연기하는거같고
그래고 하루 찾는신은 진짜 찾으러 다니는거같은데 나중에 또 전나 하루랑마주하면 지xㄹㅏㄹ할거같음

